import React from 'react';

const Article = (props) => ( 
<div>
     <h1> { props.title } </h1> 
     <h4> { props.date } </h4> 
     <meta name={ props.author } content="Kate Farley"></meta>
     <hr/>
     <p> { props.children } </p> 
</div>
);

export default Article;
